  Composite Grayscale Image of the Sidescan-Sonar Data From National Oceanic and Atmospheric
  Administration (NOAA) Survey H11079 of the Sea Floor in Great Round Shoal Channel,
  Offshore Massachusetts (H11079_UTM19_1MRSSS.TIF, UTM Zone 19)\",\n\t\"tracking_summary\":
